import { useRouteMatch, useLocation } from "react-router-dom";

export const Search: React.FC = () => {
  const match = useRouteMatch();
  const location = useLocation();

  console.log(
    location.search
      .replace(/\?/, "")
      .split(",")
      .map((value) => {
        const param = value.split("=");
        return { [param[0]]: param[1] };
      })
  );
  return <>Search</>;
};
